import React from "react";
import blogs  from "./data/blogs";

const Blogs = () => {


  return blogs.length ? (
    <section>
      <ul className="blog-list">
        { blogs.map( blog => {
          return (
            <li key={ blog.id }>
            <div className="blog-card">

              <h1>{ blog.title }</h1>

              <div>{ blog.content.map(i => {
                return <p className="blog-content">{i}</p>;
              })}</div>

            </div>
            </li>);
        })}
      </ul>
    </section>
  ) : (
    <section>
      <p>No available blogs.</p>
    </section>
  );
}

export default Blogs;
